-- ----------------------------
--  Table structure for `iel_entry`
-- ----------------------------
DROP TABLE IF EXISTS `iel_entry`;
CREATE TABLE `iel_entry` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `entry_no` varchar(200) DEFAULT NULL COMMENT '入库编号',
  `declare_num` varchar(100) DEFAULT NULL COMMENT '报关次数',
  `destination` varchar(200) DEFAULT NULL COMMENT '目的地',
  `status` int(11) DEFAULT NULL COMMENT '状态',
  `inspector` varchar(200) DEFAULT NULL COMMENT '检查员',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `ship_num` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=205 DEFAULT CHARSET=utf8;

