-- ----------------------------
--  Table structure for `iel_stock_category`
-- ----------------------------
DROP TABLE IF EXISTS `iel_stock_category`;
CREATE TABLE `iel_stock_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '类别Id',
  `admin_id` int(11) NOT NULL,
  `parent_id` int(11) DEFAULT NULL COMMENT '父类别id当id=0时说明是根节点,一级类别',
  `name` varchar(50) DEFAULT NULL COMMENT '类别名称',
  `status` tinyint(1) DEFAULT '1' COMMENT '类别状态1-正常,2-已废弃',
  `sort_order` int(4) DEFAULT NULL COMMENT '排序编号,同类展示顺序,数值相等则自然排序',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `iel_transport`
-- ----------------------------
DROP TABLE IF EXISTS `iel_transport`;
CREATE TABLE `iel_transport` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `declare_num` varchar(100) DEFAULT NULL COMMENT '报关次数',
  `destination` varchar(200) DEFAULT NULL COMMENT '目的地',
  `arrival_list` varchar(200) DEFAULT NULL COMMENT '配件到货清单',
  `purchase_list` varchar(200) DEFAULT NULL COMMENT '到货清单,带采购价格',
  `sales_contract` varchar(200) DEFAULT NULL COMMENT '公司-公司,销售合同',
  `invoice` varchar(200) DEFAULT NULL COMMENT '发票/bl等清关文件',
  `purchase_contract` varchar(200) DEFAULT NULL COMMENT '采购合同',
  `export_cost` varchar(200) DEFAULT NULL COMMENT '出口成本',
  `sales_list` varchar(200) DEFAULT NULL COMMENT '到货清单,带销售价格',
  `entrance_cost` varchar(200) DEFAULT NULL COMMENT '进口成本',
  `status` int(11) DEFAULT NULL COMMENT '状态',
