  `shipping_id` int(11) DEFAULT NULL,
  `order_detail_status` int(11) DEFAULT NULL,
  `define_ratio` decimal(20,2) DEFAULT '1.00',
  `services_ratio` decimal(20,2) DEFAULT '1.00',
  `distance_ratio` decimal(20,2) DEFAULT '1.00',
  `distance` decimal(20,2) DEFAULT '1.00',
  `repair_dates` datetime DEFAULT NULL,
  `man` varchar(50) DEFAULT NULL,
  `man_contact` varchar(50) DEFAULT NULL,
